return.description:
Return a dictionary with correct event names 
        Result on Android:       { down: "touchstart", move: "touchmove", up: "touchend", cancel: "touchcancel" }
        Result on WindowsPhone:  { down: "pointerdown", move: "pointermove", up: "pointerup", cancel: "pointercancel", out: "pointerout" }
        Result on Desktop:       { down: "mousedown", move: "mousemove", up: "mouseup", cancel: "mouseup" }

